import "./index.scss"
import bgDesktop from '../../assets/images/bg-pattern-desktop.svg'

const Home = () => {
  return (
    <>
      <div className="main d-flex align-items-center justify-content-center">
        <div className="main__card">
        <div className="main__card--left">
        <img src={bgDesktop} alt="desktop" />
        </div>
        <div className="main__card--right">
        <p>hello</p>

        </div>
        </div>
      </div>
    </>
  );
};

export default Home;
